function isPointInPoly(poly, pt){
	for(var c = false, i = -1, l = poly.length, j = l - 1; ++i < l; j = i)
		((poly[i].p_y <= pt.y && pt.y < poly[j].p_y) || (poly[j].p_y <= pt.y && pt.y < poly[i].p_y))
		&& (pt.x < (poly[j].p_x - poly[i].p_x) * (pt.y - poly[i].p_y) / (poly[j].p_y - poly[i].p_y) + poly[i].p_x)
		&& (c = !c);
	return c;
}

